import './ResortList.css';
import Resort from './Resort';
import resorts from './App'



function ResortList(props) {
  return [...props.resorts.keys()].map((item)=>{
      return <Resort key={item} resortName={item} lat={resorts.get(item)[0]} lon={resorts.get(item)[1]} appid={props.appId} />
  })
}

export default ResortList;
